void NewComponent::timerCallback()
{
	if (transportSource.isPlaying())
	{
		timeSlider->setValue(transportSource.getCurrentPosition() / transportSource.getLengthInSeconds());

		t += 0.5;
		x_pos = RADIUS*sin(t);
		y_pos = RADIUS*cos(t);
		repaint(146,62,110,110);
	}
}

